import Board from "./Board/Board"

function App(){
	const [turn,setTurn] = useState("white");

	return(
		<div>
			<Board turn={turn} setTurn={setTurn}/>
			<p style={{float:"left"}}>Turn: {turn}</p>
		</div>
	);
}


export default App;
